import React from "react";
import './Login.css'
import { Container } from "react-bootstrap";

const Login = () => {
  return (
    <div className = "login_bg">
      <Container className = "login_form">
        <div className = "box1">
        Bach Khoa 
        </div>
      </Container>
    </div>
  );
};

export default Login;
